"""
Embedded icon utility for PCTracker.
This module provides embedded icon data to avoid dependency on external assets folder.
"""
import base64
import io
from PIL import Image


# Base64 encoded icon data - ADD YOUR BASE64 DATA HERE
ICON_BASE64 = """

""".strip()


def get_embedded_icon():
    """
    Get embedded icon as PIL Image object.
    
    Returns:
        PIL.Image: The embedded icon image, or None if no icon data available
    """
    try:
        # Remove comments and whitespace from base64 data
        clean_base64 = ICON_BASE64.strip()
        if not clean_base64 or clean_base64.startswith('#'):
            return None
            
        # Decode base64 to bytes
        icon_bytes = base64.b64decode(clean_base64)
        
        # Create PIL Image from bytes
        icon_image = Image.open(io.BytesIO(icon_bytes))
        
        return icon_image
        
    except Exception as e:
        print(f"Error loading embedded icon: {e}")
        return None


def get_embedded_icon_bytes():
    """
    Get embedded icon as raw bytes.
    
    Returns:
        bytes: The embedded icon bytes, or None if no icon data available
    """
    try:
        # Remove comments and whitespace from base64 data
        clean_base64 = ICON_BASE64.strip()
        if not clean_base64 or clean_base64.startswith('#'):
            return None
            
        # Decode base64 to bytes
        icon_bytes = base64.b64decode(clean_base64)
        
        return icon_bytes
        
    except Exception as e:
        print(f"Error loading embedded icon bytes: {e}")
        return None


def create_fallback_icon():
    """
    Create a simple fallback icon if embedded icon is not available.
    
    Returns:
        PIL.Image: A simple blue square icon
    """
    try:
        # Create a simple blue square icon
        image = Image.new('RGB', (64, 64), color='#1f538d')
        
        # Add a simple "P" letter in white
        from PIL import ImageDraw, ImageFont
        draw = ImageDraw.Draw(image)
        
        try:
            # Try to use a default font
            font = ImageFont.load_default()
        except:
            font = None
            
        # Draw "P" in the center
        text = "P"
        bbox = draw.textbbox((0, 0), text, font=font)
        text_width = bbox[2] - bbox[0]
        text_height = bbox[3] - bbox[1]
        
        x = (64 - text_width) // 2
        y = (64 - text_height) // 2
        
        draw.text((x, y), text, fill='white', font=font)
        
        return image
        
    except Exception as e:
        print(f"Error creating fallback icon: {e}")
        # Return a simple blue square as last resort
        return Image.new('RGB', (64, 64), color='blue')
